Description:
This breathable, lightweight yarn is perfect for making beautiful summer sweaters, cardigans, and tank tops. Mostly composed of flax (another term for linen), it is great for any project especially machine knitting and weaving, as well as hand knitting and crocheting. Linen comes in a variety of weights and textures, and flax is one of them.

This is a lovely natural yarn for hand dyeing projects and will be great for space dyeing or variegating.

&nbsp;

<strong>Contents:</strong>&nbsp;40% Flax | 31% Cotton | 29% Rayon

<strong>Weight:&nbsp; Metallic , </strong>1 lb per cone - <strong>Plain,&nbsp;</strong>0.7-0.9 lb per cone

<strong>YPP:&nbsp;</strong>1360&nbsp;

<strong>WPI: [plain]</strong> 17 wraps per inch (lace)<strong> [metallic<span style="text-decoration: underline;">]</span></strong>&nbsp;14 wraps per inch (fingering)

&nbsp;

<strong>Priced per cone.</strong>

<strong>Please note: All sales on closeouts are final!</strong>&nbsp;Photos show an example of the color you will receive, actual cone type may vary. Colors can vary based on your monitor settings – we do our best to try to match the colors accurately.

&nbsp;

Rayon Bouclé yarn is a textured rayon yarn that keeps the drape and sheen of rayon but adds a crimped texture. By itself it makes an excellent shawl/scarf sweater or vest, or it can also add shine as an accent in your other projects mixed with fibers like cotton yarn or wool yarn

&nbsp;

<strong>Contents:</strong> 88% rayon | 12% polyester

<strong>Weight:</strong>&nbsp; 0.7-0.9 lbs per cone

<strong>YPP:</strong>&nbsp; 2300

<strong>WPI:&nbsp;</strong>undefined (roughly 22)

&nbsp;

<strong>Care:</strong> Hand wash and dry flat, with a brief tumble in the dryer – or dry clean

