These 4 lb mystery boxes contain many cones of different types of fibers for experimentation! Some of these are yarns we regularly produce and have odd lots or the stray cone of, others are experiments.

There can be anything in your box from wool, silk, linen, acrylic, nylon, poly, and many, many blends.

