This gimp metallic yarn or cord yarn is a great add in with other yarns. Great for jewelry making as a moving replacement for wire. Weavers can add it into their set occasionally to create a unique effect. Knitters can create I-cord chains to add neat boarders onto finished items or hold it with another yarn to give it some glitz. Crocheters and tatters can use it to create endless trims and edge motifs, in addition to holiday ornaments.

<strong>Contents:</strong>&nbsp;77% polypropylene | 23% metallic

<strong>WPI:</strong>&nbsp;64&nbsp;

&nbsp;

