This is a super fine and very soft wool/rayon yarn. Add a little pop of bright color to any project! Perfect for weaving fine and delicate fabrics, lace crocheting, or fine gauge machine knitting. This yarn has a very soft and fine hand and will make fabrics look very luxurious with beautiful drape.

